import './App.css';
import Home from './Components/Home';
import { useEffect, useState} from 'react';
import ProductContainer from './Components/ProductContainer'
import {BrowserRouter as Router, Switch,Route} from "react-router-dom"
import Profile from './Components/Profile'
import Cart from './Components/Cart'


function App() {
  const [products, setProducts] = useState([])
  const [cart, setCart] = useState([])

  const API = "http://localhost:3000/products"
  useEffect(() => {
    async function fetchProducts(){
      const result = await fetch(API);
      const items = await result.json();
      setProducts(items)
    }
    fetchProducts()

  }, [])


  return (
    <div className="App">
      {/* <Home products={products}/> */}
      <Router>
          <Switch>
          <Route exact path="/" component={() => <Home products={products}/>} />
          <Route exact path="/cart" component={() => <Cart products={products} cart={cart} setCart={setCart}/>} />
          <Route exact path="/user" component={() => <Profile products={products}/>} />
          <Route exact path="/products" component={()=><ProductContainer products={products} cart={cart} setCart={setCart}/>}/>        
          </Switch>
      </Router>
    </div>
  );
}

export default App;
